      <header>
        <img src={ titulo } alt="imagem do título" className="tituloImg" />
        <button onClick={() => {
          const MissionsEl = document.getElementById(('Missions'));
          MissionsEl.scrollIntoView({behavior: 'smooth'})
        }}></button>
      </header>
    );
  }
}

export default Header;
